import React from "react";
import { Provider } from "react-redux";
import store from "./store";
import UserData from "./UserData";

const App = () => {
  return (
    <Provider store={store}>
      <div>
        <h1>Thunk</h1>
        <UserData />
      </div>
    </Provider>
  );
};

export default App;
